import React from "react";
import { DragDropContext, Droppable } from "react-beautiful-dnd";

const finalSpaceCharacters = [
  {
    id: "gary",
    name: "Gary Goodspeed",
    thumb: "https://images.pexels.com/photos/268533/pexels-photo-268533.jpeg?cs=srgb&dl=pexels-pixabay-268533.jpg&fm=jpg",
  },
];

const Drag = () => {
  {
    finalSpaceCharacters.map(({ id, name, thumb }, index) => {
      return (
        <div>
         
          <DragDropContext>
            <Droppable
              key={id}
              draggableId={id}
              index={index}
              droppableId="characters"
            >
              {(provided) => (
                <ul
                  className="characters"
                  {...provided.droppableProps}
                  ref={provided.innerRef}
                >
                  <li
                   key={id}
                  >
                    <div className="characters-thumb">
                      <img src={thumb} alt={`${name} Thumb`} />
                    </div>
                    <p>{name}</p>
                  </li>
                </ul>
              )}
            </Droppable>
          </DragDropContext>
        </div>
      );
    });
  }
};

export default Drag;
